      SELECT - 51 * col0 FROM tab2 (FORMAT parquet) WHERE - - 46 * - - col0 BETWEEN ( col1 * + - col0 * - CAST ( - + col1 AS INTEGER ) ) AND + ( + CAST ( NULL AS INTEGER ) );
  - name: tab2

outputs:
  - name: q8525.out
    data: |
